The Rock Snob's Dictionary
At last! An A-to-Z reference guide for readers who want to learn the cryptic language of Rock Snobs, those arcana-obsessed people who speak of &quot;Rickenbacker guitars&quot; and &quot;Gram Parsons.&quot; ?&amp;nbsp;?We've all been there--trapped in a conversation with smarty-pants music fiends who natter on about &quot;the MC5&quot; or &quot;Eno&quot; or &quot;the Hammond B3,&quot; not wanting to let on that we haven't the slightest idea what they're talking about. Well, fret no more! The Rock Snob's Dictionary is here to define every single sacred totem of rock fandom's know-it-all fraternity, from Alt.country to Zimmy. (That's what Rock Snobs call Bob Dylan, by the way.)
